import checkService from "./API/checkService";
import {useEffect, useState} from "react";
import './styles/App.css'
import ar from './utils/img/arrow.png'
function App() {

    const [service, setService] = useState([])
    const [course, setCourse] = useState('')

    useEffect(() => {
        checkService.getCourses().then(a => setService(a))
    }, [])

    return (
    <div className="App">
        <div>{course}</div>
      <div className={"chooseDiv"}>
          {service.map((a) => <div key={a.id} className={"course"} onClick={() => setCourse(a.name)}>{a.name}</div>)}
          <div><img src={ar}/></div>
      </div>
    </div>
    );
}

export default App;
